import React from 'react';
import './App.css';
import { Provider } from 'react-redux';
import store from './redux/store.js';

function App() {
  return (
      <Provider store={store}>
          <div className="App">
            <div>Hello</div>
          </div>
      </Provider>

  );
}

export default App;
